          path="/*" 
          element={
            <Common loggedInUsername={loggedInUsername}/>}/>
      </Routes>
      {/* <div className={isLoggedIn === true ? 'inCarePlus':'outCarePlus'}>
        <Header loggedInUsername={loggedInUsername}/>
        <Sidebar/>
      </div> */} 
 <Routes>
  <Route path="/" element={<Login  onLoginSuccess={handleLoginSuccess}/>}/>
